script: |
  super -f text -I q1128.spq | sort > q1128.out

inputs:
  - name: q1128.spq
    data: |
      SELECT DISTINCT + COUNT ( * ) * + - 65 AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q1128.out
    data: |
      -585
